import {
    AuthErrPage,
    CompositionsContainer, ErrorPage,
    HomeContainer, OrderFormContainer, OrderFormSucceed, SuggestFormContainer, SuggestFormSucceed
} from "../views/pages";


export const authRoutes = [
    {
        path: '/suggest',
        exact: true,
        auth: true,
        component: SuggestFormContainer
    },
    {
        path: '/suggest/success',
        exact: true,
        auth: true,
        component: SuggestFormSucceed
    },
    // {
    //     path: '/showcase/:id',
    //     exact: false,
    //     auth: true,
    //     component: ShowcaseContainer
    // },
    {
        path: '/compositions/:id',
        exact: false,
        auth: true,
        component: OrderFormContainer
    },
    {
        path: '/compositions/:id/success',
        exact: false,
        auth: true,
        component: OrderFormSucceed
    },
    {
        path: '/auth',
        exact: true,
        auth: false,
        component: AuthErrPage
    },
    {
        path: '*',
        exact: true,
        auth: false,
        component: ErrorPage
    }
];

export const publicRoutes = [
    {
        path: '/',
        exact: true,
        component: HomeContainer
    },
    {
        path: '/compositions',
        exact: false,
        component: CompositionsContainer
    }
];
